import './App.css';
import React, {useState} from 'react';

function App() {
  let posts = '강남 고기 맛집';
  return (
    <div className="App">
      <div className="black-nav">
        <div>개발 Blog</div>
      </div>

      <div className="list">
        <h3> {posts} </h3>
        <p>4월 30일 발행</p>
        <hr/>
      </div>
    </div>
  );
}

export default App;
